import React from "react";

import "./ProjectsList.css";

import Project from "./Project";
import projectsInfo from "../../infos/projects/projects";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

const projectsList = props => (
  // <ul className="list-unstyled">
  <div style={{ width: "100%" }}>
    <Container fluid>
      <Row>
        <Col lg={{ offset: 1, order: 2 }}>
          <p
            style={{ marginTop: window.innerHeight / 5 }}
            className="time-table__title"
          >
            Time-Line
          </p>
        </Col>
        <Col lg={{ offset: 1 }}>
          {projectsInfo.map(projectInfo => (
            <Container fluid>
              <Project
                image={projectInfo.image}
                title={projectInfo.title}
                explanation={projectInfo.explanation}
                paper={projectInfo.paper}
                github={projectInfo.github}
              />
            </Container>
          ))}
        </Col>
      </Row>
    </Container>
  </div>
  // </ul>
);

export default projectsList;
